  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tewaukon
  NWR and Tewaukon WMD outlines Refuge accomplishments during the 1990 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, public participation, and research and investigations. Refuge
  administration is outlined; information about personnel, youth programs, volunteer
  programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, forests, croplands, grasslands, grazing,
  haying, fire management, pest control, water rights, wilderness areas, and WPA easements.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, raptors, game mammals,
  fisheries resources, wildlife propagation, animal control, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about major maintenance, equipment replacement, communication
  systems, and computer systems. Items of interest are provided at the end.\",\n\t\"owner_org\":
